import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component{

  constructor(){
    super();

    this.state ={
      monsters: [
        {
          name: 'Frankenstein',
          id: 'MON1'
        },
        {
          name: 'Dracula',
          id: 'MON2'
        },
        {
          name: 'Zombie',
          id: 'MON3'
        }
      ]
    }
  }

  render(){
    return (
      <div className="App">
        {
          this.state.monsters.map( monster => 
            ( <h1 id={monster.id}> { monster.name } </h1> )
          )
        }
      </div>
    )
  }
}

export default App;
